export default function Home() {
  return (
    <div className="mx-12 mt-4 bg-black">
      <nav className="flex justify-between items-center h-9">
        <div className="bg-yellow-500 w-5 ratio-square"></div>
        <h1>EST SB</h1>
        <button className="bg-white text-black"></button>
      </nav>
      <h1></h1>
    </div>
  );
}
